//SPDX-License-Identifier: MIT

pragma solidity 0.7.5;
pragma abicoder v2;

import "./ERC666.sol";


contract BrutesFactory is ERC666 {

    struct Brute {
        uint class;
        uint breedCount;
        address owner;
        uint[5] stats;
        uint[] skills;
        uint sex; // 0 male, 1 femelle, 2 non binaire, 3 mort
        uint[2] lineage; //0 = id du pere et 1 = id de la mere
        uint[5][3] genes; // genes[0] = dominant, genes[1]=rece1 et genes[2]=rece2 
    }

    Brute[] public brutes;
    Brute[] public baseBrutes;
    uint private nonce;
    
    modifier isNotDead(uint _id){
        require(brutes[_id].sex !=2, "dead brute");
        _;
    }

    function _generateRandomness(string memory _statName,uint mod) internal view returns (uint){
        return uint(keccak256(abi.encodePacked(nonce, block.timestamp, msg.sender, _statName))) % mod;
    }

    function getBrutes() external view returns(Brute[] memory){
        return brutes;
    }
   
        /////////////////////
        ///// genetics //////
        /////////////////////

    function _genesisGenes() internal returns(uint[5][3] memory){
        uint[5][3] memory genes;
        for (uint i=0; i<3;i++){
            for (uint j=0; j<5;j++){
                genes[i][j]=_generateRandomness("genes", 5);
                nonce ++;
            }
        }
        nonce= nonce-14;
        return genes;
    }
    
    function _createGenesBaby(uint[5][3] memory _papa, uint[5][3] memory _mama) internal returns(uint[5][3] memory){
        uint[5][3] memory genes;
        for(uint i = 0; i < 3; i++){
            for(uint j = 0; j < 5; j++){
                uint factor = _generateRandomness("sexOfParentUsed", 2 );
                uint factor2 = _generateRandomness("typeOfGene", 51);
                nonce ++;
                uint targetGene;
                uint[5][3] memory partFrom;

                if(factor == 0) {partFrom = _papa;}
                else if(factor == 1) {partFrom = _mama;}
        
                if(factor2 < 35) {targetGene = partFrom[0][j];}
                else if(factor2 >= 35 && factor2 < 45) {targetGene = partFrom[1][j];}
                else if(factor2 >= 45 && factor2 < 51){targetGene = partFrom[2][j];}
                genes[i][j] = targetGene;
            }
        }
        return genes;
    }
  
        ///////////////////////////
        ////// stat generation ////
        ///////////////////////////

    function _generateRandomStats() internal view returns (uint[5] memory){
        return [_generateRandomness("HP", 20), _generateRandomness("Attack", 5), _generateRandomness("HitChance", 20), _generateRandomness("Agility", 5), _generateRandomness("Def", 5)];
    }

    /**
    * @notice 0 == warrior ; 1 == warrior;   2 == archer; 3 == lamuraille; 
    *
     */
    function _generateClassStats(uint _classNum) internal pure returns (uint[5] memory classStats){
        require(_classNum <= 3, "Class doesn't exist");
        if(_classNum == 0){
            return [uint(90), 40, 20, 30, 10];
        }
        if(_classNum == 1){
            return [uint(110), 20, 20, 20, 20];
        }
        if(_classNum == 2){
            return[uint(120), 40, 20, 30, 10];
        }
        if(_classNum == 3){
            return[uint(130), 30, 20, 20, 10];
        }
    }

    function _generateStats(uint _classNum) public returns(uint[5] memory){
        uint[5] memory classStats = _generateClassStats(_classNum);
        uint[5] memory randStats = _generateRandomStats();
        nonce ++;
        uint[5] memory totalStats;
        totalStats[0] = classStats[0] + randStats[0];
        totalStats[1] = classStats[1] + randStats[1];
        totalStats[2] = classStats[2] + randStats[2];
        totalStats[3] = classStats[3] + randStats[3];
        totalStats[4] = classStats[4] + randStats[4];
        return totalStats;
    }


        ////////////////////
        ////// creation ////
        ////////////////////

    function _generateBaseBrute(uint _classNum, uint _sex, uint _genes) internal view returns (Brute memory b){ 
        uint[5][3] memory baseDNA=[[_genes,_genes,_genes,_genes,_genes],[_genes,_genes,_genes,_genes,_genes],[_genes,_genes,_genes,_genes,_genes]];
        Brute memory newGenisisBrute;
        newGenisisBrute.stats = _generateClassStats(_classNum);
        newGenisisBrute.genes = baseDNA;
        newGenisisBrute.sex = _sex;
        newGenisisBrute.class=_classNum;
        newGenisisBrute.owner = address(this);
        return newGenisisBrute;
    }

    function _genisisBrute(uint _classNum, address _owner) internal returns (Brute memory b) { 
        Brute memory newGenisisBrute;
        newGenisisBrute.stats = _generateStats(_classNum);
        newGenisisBrute.genes = _genesisGenes();
        newGenisisBrute.sex = _generateRandomness("sex", 2);
        newGenisisBrute.class =_classNum;
        newGenisisBrute.owner = _owner;
        return newGenisisBrute;
    }

    function _breedBrute( uint _papaID, uint _mamaID, address _owner) internal returns (Brute memory b) {
        require(brutes[_papaID].breedCount <= 5 && brutes[_mamaID].breedCount <= 5, "No more breeding");
        require(brutes[_papaID].owner == _owner && brutes[_mamaID].owner == _owner, "you don't possess those brutes");
        require( brutes[_papaID].sex == 0 && brutes[_mamaID].sex == 1, "The laws of nature don't work that way");
        uint classRand = _generateRandomness("classWhichParent", 2);
        Brute memory babyBrute;
        if(classRand == 0) {babyBrute.class = brutes[_papaID].class;}
        else if(classRand == 1) {babyBrute.class = brutes[_mamaID].class;}
        babyBrute.stats = _generateStats(babyBrute.class);
        babyBrute.genes = _createGenesBaby(brutes[_papaID].genes, brutes[_mamaID].genes);
        babyBrute.lineage[0] = _papaID;
        babyBrute.lineage[1] = _mamaID;
        babyBrute.sex = _generateRandomness("sex", 2);
        babyBrute.owner = _owner;
        return babyBrute;
    }
    

        ////////////////////
        ////// ERC666 //////
        ////////////////////

    function mintGenisisBrute(uint _classNum) external {
        Brute memory brute =_genisisBrute(_classNum, msg.sender);
        brutes.push(brute);
        _mint(_NFT, _categoryNFTbrutes, msg.sender, 1);
        OwnerOf[_categoryNFTbrutes][brutes.length -1] = msg.sender;
    }

    function mintSFTbaseBrute(uint _classNum, uint _sex, uint _genes, uint  _amount) internal {
        Brute memory brute =_generateBaseBrute(_classNum, _sex, _genes);
        baseBrutes.push(brute);
        _mint(_NFT, _categoryNFTbrutes, address(this), _amount);
        OwnerOf[_categoryNFTbrutes][brutes.length -1] = msg.sender;
    }

    function Breed(uint _papaID, uint _mamaID) external {
        Brute memory brute =_breedBrute(_papaID, _mamaID, msg.sender);
        brutes.push(brute);
        _mint(_NFT, _categoryNFTbrutes, msg.sender, 1);
        brutes[_papaID].breedCount++;
        brutes[_mamaID].breedCount++;
        OwnerOf[_categoryNFTbrutes][brutes.length -1] = msg.sender;
    }
    
    function buySFTBrute(uint _id) external payable {
        (bool success, ) = msg.sender.call{value:0.01 ether}("");
        require(success, "Transfer failed.");
        Brute memory brute = baseBrutes[_id];
        brute.owner = msg.sender;
        brutes.push(brute);
        _burn(_SFT, _categorySFTbrutes, address(this), 1);
        _mint(_NFT, _categoryNFTbrutes, msg.sender, 1);
